import React, { useState } from "react";
import Cards from "./components/Cards";
import "./App.css";
import { Grid } from "@material-ui/core";

function App() {
  return (
    <>
      <Grid container spacing={2} justify="center">
        <Grid item>
          <Cards text={"Confirmed"} value={100} />
        </Grid>
        <Grid item>
          <Cards text={"Deaths"} value={200} />
        </Grid>
        <Grid item>
          <Cards text={"Recovered"} value={300} />
        </Grid>
      </Grid>
    </>
  );
}

export default App;
